import React from 'react';
import './TopBar.css'

function TopBar({ onPrintButtonClick }) {
  return (
    <div className="top-bar">
      {/* Use the onPrintButtonClick function when the button is clicked */}
      <PrintButton onClick={onPrintButtonClick} />
    </div>
  );
}

export default TopBar;
